public int hashCode() {
    	int result = 127;
    	int size = size();
    	result = HashUtilities.hashCode(result, size());
        if (size > 0) {
            result = HashUtilities.hashCode(result, this.objects[0]);
            if (size > 1) {
                result = HashUtilities.hashCode(result, this.objects[size - 1]);
                if (size > 2) {
                    result = HashUtilities.hashCode(result,
                    		this.objects[size / 2]);
                }
            }
        }
        return result;
